	useEffect(() => {
		audioService.getAll().then((data) => {
			console.log(data);

			setAudioList(data);
		});
	}, []);

	return (
		<div>
			{/* <AudioPlayer ref={audioPlayerRef} /> */}
			{/* <Transcript audioPlayerRef={audioPlayerRef} /> */}
			<AudioList audioList={audioList} setAudio={setAudio} />
		</div>
	);
};

export default App;
